import './All_tools.css';
import railsimage from '../../../images/Icons/rails.png';
import javascript from '../../../images/Icons/JavaScript.png';
import react from '../../../images/Icons/React.png';
import redux from '../../../images/Icons/Redux.png';
import restapi from '../../../images/Icons/RESTAPI.jpeg';
import postgresql from '../../../images/Icons/Postgresql.png';
import html from '../../../images/Icons/HTML.png';
import bootstraps from '../../../images/Icons/Bootstrap.png';
import github from '../../../images/Icons/GitHub.png';
import figma from '../../../images/Icons/Figma.png';
import trello from '../../../images/Icons/Trello.png';
import salesforce from '../../../images/Icons/Salesforce.jpeg';


function AllTools() {

  function HoverHandler() {
    console.log("Rails icon!")
  }

  return (
    <div className="icons_container">
      <h2>My Tools</h2>
      <img className="icon" onMouseOver={HoverHandler} src={railsimage} alt="Rails icon" />
      <img className="icon" src={javascript} alt="JavaScript icon" />
      <img className="icon" src={react} alt="React icon" />
      <img className="icon" src={redux} alt="Redux icon" />
      <img className="icon" src={restapi} alt="REST API icon" />
      <img className="icon" src={postgresql} alt="POSTGRESQL icon" />
      <img className="icon" src={html} alt="HTML icon" />
      <img className="icon" src={bootstraps} alt="Bootstraps icon" />
      <img className="icon" src={github} alt="Github icon" />
      <img className="icon" src={figma} alt="Figma icon" />
      <img className="icon" src={trello} alt="Trello icon" />
      <img className="icon" src={salesforce} alt="Salesforce icon" />
    </div>
  )
}

export default AllTools;
